import { Button } from '@material-ui/core';
import DeleteIcon from '@material-ui/icons/Delete';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <Button 
          variant="contained"
          color="primary"
          size="large"
          disableElevation
          startIcon={<DeleteIcon />}
          disableRipple
          con
        >
          Raphael
        </Button>
      </header>
    </div>
  );
}

export default App;
